import React from "react";

class Android extends React.Component {
    render() {
        return (
            <>
                 <h1 className="middle">Android</h1>
                <main className="grid" style={{paddingLeft: "2%", paddingRight: "2%"}}>
                    <div className="grid-around-space">
                        <div className="middle">
                        <span >Test</span>
                        
                        <img alt="" src="https://raw.githubusercontent.com/SillyGoose123/NimmGameApp/main/app/src/main/res/mipmap-xhdpi/ic_launcher.png"/>
                        </div>
                    </div>
                </main>      
            </>
        )
    }
}

export default Android;
